IO Explanation and Notes:
0 – No Alarm; 1 – Level 0 Alarm (Log-Stored / Routine Maintenance Required);
2 – Level 1 Alarm (Low Fuel);
3 – Level 2 Alarm (Maintenance Past Due);
4 – Level 3 Alarm (Reserved for Future Use);
5,6,7 – Level 4,5,6 Alarms (Reserved for Future Use);
8 – Level 7 Alarm (Check / Immediate Attention Required);
9,10,11,12,13,14 – Level 8,9,10,11,12,13 Alarms (Reserved for Future Use);
15 – Level 14 Alarm (Shutdown or Catastrophic System Failure)

If 0x0 – nothing;
If 0x1 – phone call attempt was made successfully;
If 0x2 – phone call attempt was made, but there was GSM problems;
If 0x3 – phone call attempt was made, but there was no answer from recipient;
If 0x4 – phone call attempt was made, but recipient was busy;
If 0x5 – local hangup;
If 0x6 – remote hangup;
If 0x7 – Incoming call;
If 0x8 - Device is ringing.

0 – DOUT activation mechanism is disabled;
1 – DOUT activation mechanism is enabled
2 – DOUT activation mechanism is armed (Speed limit is exceeded);
3 – DOUTs are activated;
4 – DOUT mechanism is deactivated after timeout;
5 – DOUT mechanism is deactivated after speed dropped below configured. This I/O state is valid till the generation of next record.

0 – DOUT activation mechanism is disabled;
1 – DOUT activation mechanism is enabled
2 – DOUT activation mechanism is activated (Voltage limit is exceeded or voltage dropped below);
3 – DOUT mechanism is deactivated after timeout. This I/O state is valid till the generation of next record.;
4 – DOUT mechanism is deactivated after voltage has dropped or raises above the limit. This I/O state is valid till the generation of next record.

0 – DOUT activation mechanism is disabled;
1 – DOUT activation mechanism is enabled
2 – DOUT activation mechanism is armed (DIN state has changed into selected state);
3 – DOUTs are activated;
4 – DOUT mechanism is deactivated after timeout;
5 – DOUT mechanism is deactivated after DIN status change. This I/O state is valid till the generation of next record.

0 – DOUT activation mechanism is disabled;
1 – DOUT activation mechanism is enabled;
2 – DOUT activation mechanism is armed;
3 – DOUT is activated;
4 – DOUT is deactivated;

B1: Anti-hijack state
0 – Not configured;
1 – Configured, idle;
2 – Armed, speed above threshold;
3 – Immobilizer workflow in progress;
4 – Speed 0 or engine off, DOUT activated constantly;
5 – In deactivation period;
6 – In reactivation period;
7 - In "guaranteed unrestricted time period";
B2: Anti-hijack source
0 – Unknown or Not applicable (for 'Anti-hijack state' values 0,1,7);
1 -- SMS of type “ahj-on *” was received;
2 -- SMS of type “ahj-on A,B,C” was received;
3 -- SMS of type “ahj-off A,B” was received;
4 – Jamming;
5 – Parameter value condition;

0b -> Front Left; 1b -> Front Right; 2b -> Back Left;
3b -> Back Right; 7b -> Sunroof.
(Used only for cars, that provide window POSITION, not STATUS; e.g. Toyota...)
